import React from 'react';
import Netflix from './Netflix';


console.log(Sdata[0].sname);
  
 const favSeries = 'netFlix';


 const FavS = ()=>{
  if(favSeries == 'netFlix'){
    return (
     <Netflix />
     );
     
   }else{
    return (
      <Card 
       key = {Sdata[2].id}
       imgsrc={Sdata[2].imgsrc}
       title={Sdata[2].title} 
       sname={Sdata[2].sname}
       link={Sdata[2].link}
      />
     );
   }
 }

 
 

const App = () =>{
    return(
    <>

    <h1>List og Top 5 Netflix in 2021</h1>
    <div className="flexBox">
   
   
   
     <FavS />
   
   
    </div>
    
   
   </>
    )
}

export default App;
